#create a list to store lines containing species names followed by the text in the "Habitat and Ecology" sections of their respective IUCN assessments
table = ["species\tIUCN_habitat_and_ecology_notes"]

for i in range(0, len(herbSpDict)):
	#pull up a species' IUCN assessment from the Internet using its taxon ID
	if herbSpDict[sorted(herbSpDict.keys())[i]] != "":
		page = urllib2.urlopen("http://www.iucnredlist.org/details/%s/0" %herbSpDict[sorted(herbSpDict.keys())[i]])
		#create a soup object
		soup = BeautifulSoup(page)
		#visualize the html code
		#print(soup.prettify())
		#find all the "td" tags in the html code
		tdTags = soup.find_all("td")
		#find the "td" tag in the html code corresponding to the "Habitat and Ecology" section
		for j in range(0, len(tdTags)):
			if tdTags[j].text.encode("utf-8").strip() == "Habitat and Ecology:":
				#then find the next "td" section, which contains the paragraph on "Habitat and Ecology"
				habEcol = tdTags[j+1]
		#extract the text from this section
		habEcolText = habEcol.text.encode("utf-8").strip()
		#write a tab-separated string containing the species name and the habitat and ecology notes
		line = "%s\t%s" %(sorted(herbSpDict.keys())[i], habEcolText)
		#append the string to the list
		table.append(line)
		print(sorted(herbSpDict.keys())[i])
	
#join the items in the list together into one string for exporting
outText = "\n".join(table)
#create a file to export the string to
outFile = open("herb_sp_IUCN_Red_List_habitat_ecology_data_022417.txt", "w")
#export the string
out = outFile.write(outText)
#close the export file
outFile.close()
